import React, {Component} from "react";
import "./App.css";

class App extends React.Component {
  render() {
    return (
      <div>
        <div>
          <h1> 카 고</h1>
          <h6>주변카페 자리를 확인해보세요~</h6>
        </div>

        <div >
          <input id="seearch" type="search"></input>
          <input id="searchBton" type="submit" value="검색"></input>
        </div>

        <div id="App-Btn">
          <a className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
          >
          </a>현재 위치로 확인
        </div>


      </div>
    );
  }
}


export default App;
